// create element
function ce(n) { return document.createElement(n); } // end of function

// add style
function addStyle(css) {
    var head = document.head || document.getElementsByTagName('head')[0];
    if (head) {
        var style = ce("style");
        style.type = "text/css";
        style.appendChild(document.createTextNode(css));
        head.appendChild(style);
    } // end if
} // end of function

// global variables
var position,
// figure out if this is moz || IE because they use documentElement
el = (navigator.userAgent.indexOf('Firefox') != -1 || navigator.userAgent.indexOf('MSIE') != -1) ? document.documentElement : document.body,
// timer
t1, t2,
// z-index
zIindex = 1001;// edit this value

function click1(item, index) {
  item.children[2].click();
}
function click2(item, index) {
  item.click();
}
function click3(item, index) {
  item.children[3].click();
}
function click4(item, index) {
  item.children[0].click();
}

function click_ok(){
    var ok = Array.from(document.getElementsByClassName('goog-buttonset-default goog-buttonset-action'));
    ok.forEach(click2);
}
function whenAvailable(callback) {
    var interval = 10; // ms
    var assets = document.getElementsByClassName('asset-id-root-select')
    var loaded = 0
    for (var i = 0; i < assets.length; i++) {
        if (assets[i].textContent.includes("users/")){
            loaded += 1
            console.log(assets[i].textContent)
        }
    }
    setTimeout(function() {
        if (loaded>assets.length-1) {
            callback();
        } else {
            setTimeout(whenAvailable(callback), interval);
        }
    }, interval);
}


function clickPublic(){
  var tasks = Array.from(document.getElementsByClassName('is-public-checkbox'));
  // console.log(tasks)
  tasks.forEach(click4);
  setTimeout(whenDoneAvailable, 1000, clickDone);
}

function whenAclAvailable(acl_list, callback) {
    var interval = 10; // ms
    var dialogs = document.getElementsByClassName('modal-dialog asset-sharing-dialog')
    // var assets = document.getElementsByClassName('is-public-checkbox')
    setTimeout(function() {
        if (dialogs.length == acl_list.length) {
            console.log(dialogs)
            callback();
        } else {
            setTimeout(whenAclAvailable(acl_list, callback), interval);
        }
    }, interval);
}


function whenDoneAvailable(callback) {
    var interval = 10; // ms
    var loadings = document.getElementsByClassName('modal-dialog asset-sharing-dialog loading')
    // console.log(loadings)
    setTimeout(function() {
        if (loadings.length == 0) {
            callback();
        } else {
            // console.log(loadings)
            setTimeout(whenDoneAvailable(callback), interval);
        }
    }, interval);
}


function clickDone() {
  var ok = Array.from(document.getElementsByClassName('modal-dialog-buttons'));
  // console.log(ok)
  ok.forEach(click4);
}


// submit
function submit() {
  var tasks1 = Array.from(document.getElementsByClassName('task local type-EXPORT_IMAGE awaiting-user-config'));
  var tasks2 = Array.from(document.getElementsByClassName('task local type-EXPORT_FEATURES awaiting-user-config'));
  var tasks = tasks1.concat(tasks2)
  // console.log(tasks)
  tasks.forEach(click1);
  var assets = document.getElementsByClassName('asset-id-root-select')
  if (assets.length > 0) {
      whenAvailable(click_ok)
  }else{
      click_ok()
  }

} // end of function

// cancel running
function cancel_running() {
    var tasks1 = Array.from(document.getElementsByClassName('task local type-EXPORT_IMAGE running-on-backend'));
    var tasks2 = Array.from(document.getElementsByClassName('task local type-EXPORT_FEATURES running-on-backend'));
    var tasks3 = Array.from(document.getElementsByClassName('task remote type-EXPORT_IMAGE running-on-backend'));
    var tasks4 = Array.from(document.getElementsByClassName('task remote type-EXPORT_FEATURES running-on-backend'));
    var tasks = tasks1.concat(tasks2).concat(tasks3).concat(tasks4);
    tasks.forEach(click3);
    // console.log(tasks)
    click_ok()
} // end of function

// cancel unrunning
function cancel() {
    var tasks1 = Array.from(document.getElementsByClassName('task local type-EXPORT_IMAGE submitted-to-backend'));
    var tasks2 = Array.from(document.getElementsByClassName('task remote type-EXPORT_IMAGE submitted-to-backend'));
    var tasks3 = Array.from(document.getElementsByClassName('task local type-EXPORT_FEATURES submitted-to-backend'));
    var tasks4 = Array.from(document.getElementsByClassName('task remote type-EXPORT_FEATURES submitted-to-backend'));
    var tasks = tasks1.concat(tasks2).concat(tasks3).concat(tasks4);

    tasks.forEach(click3);
    // console.log(tasks)
    click_ok()
}; // end of function


function changeACL() {
  var asset_name = document.getElementById("SearchBar").value;
  console.log(asset_name);
  // var tasks1 = document.getElementsByClassName('tree-item tree-file file-type-image');
  // var tasks2 = document.getElementsByClassName('tree-item tree-file file-type-table');
  // var tasks3 = document.getElementsByClassName('tree-item tree-file file-type-image-collection');
  // var tasks = tasks1.concat(tasks2).concast(tasks3)

  // var roots = document.getElementsByClassName('tree-item tree-folder tree-root');
  // var assets = roots[roots.length-1].firstChild.children;

  var am = document.getElementsByClassName('tree-manager asset-manager')[0];
  var assets = am.getElementsByClassName('tree-item tree-folder tree-root')[0].firstChild.children;
  var acl_list = []
  for (var i = 0; i < assets.length; i++){
        if(assets[i].textContent.includes(asset_name)){
            assets[i].children[2].click()
            acl_list.push(assets[i])
            console.log(assets[i])
        }
    };
  whenAclAvailable(acl_list, clickPublic);

};



function shareCSS(){
    // variables
    var s='', img_submit, img_cancel, img_cancel_running, img_acl;

	// img vs button
    img_submit = 'data:image/png;base64,';
	img_cancel = 'data:image/png;base64,';
    img_cancel_running = 'data:image/png;base64,';
    img_acl = 'data:image/png;base64,'
    // button id
    s+='#submit { position:fixed; right:400px; top:43px;   z-index:'+zIindex+'; height:26px; width:78px; cursor:pointer; background:url('+img_submit+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    s+='#cancel { position:fixed; right:310px; top:43px;   z-index:'+zIindex+'; height:26px; width:78px; cursor:pointer; background:url('+img_cancel+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    s+='#cancel_running { position:fixed; right:156px; top:43px;   z-index:'+zIindex+'; height:26px; width:142px; cursor:pointer; background:url('+img_cancel_running+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    s+='#SetAcl { position:fixed; right:490px; top:43px;   z-index:'+zIindex+'; height:26px; width: 114px; cursor:pointer; background: url('+img_acl+') no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:5px 0 0 5px; margin-top:-24px; }';
    s+='#SearchBar { position:fixed; right:620px; top:40px;   z-index:'+zIindex+'; height:26px; width:100px; cursor:pointer; background: #ddd no-repeat scroll 50% 50% rgba(0, 0, 0, 0); border-radius:0 0 0 0; margin-top:-24px; }';
    // button class
    s+='.play_btn { -webkit-transition-duration:0.5s linear; -o-transition-duration:0.5s linear; -moz-transition-duration:0.5s linear; transition-duration:0.5s linear; opacity:0.65; }';
    s+='.play_btn:hover { opacity:1; }';
	// append
    addStyle(''+s);
} // end of function

// main
function create_btn_element() {
    // get scroll
	var sub, can, canr,
	    scrolled, SearchButton;
	shareCSS();

	// if
	if(el){
		// create DOM element
		sub = ce('span');
		can = ce('span');
        canr = ce('span');
        SearchButton = ce('span')

        // add search bar
        var SearchBar = document.createElement("INPUT");
        SearchBar.setAttribute("id", "SearchBar");
        //SearchBar.setAttribute("value", "Some text");
        SearchBar.setAttribute("placeholder", "Asset name");

        // add search button
        // var SearchButton = document.createElement("INPUT");
        //SearchButton.setAttribute("type", "button");
		// set attribute
		sub.setAttribute('id','submit');
		can.setAttribute('id','cancel');
        canr.setAttribute('id','cancel_running');
        SearchButton.setAttribute('id','SetAcl');

		// set class
		sub.className = "play_btn";
		can.className = "play_btn";
        canr.className = "play_btn";
        SearchButton.className = "play_btn";
        // append element
		document.body.appendChild(sub);
		document.body.appendChild(can);
        document.body.appendChild(canr);
        document.body.appendChild(SearchButton);
        document.body.appendChild(SearchBar);

		// add event over
		sub.addEventListener('click', submit, false);
		can.addEventListener('click', cancel, false);
        canr.addEventListener('click', cancel_running, false);
        SearchButton.addEventListener('click', changeACL, false);

		// add event out

	} // end if
} // end of function

// run it
create_btn_element();
